h^2 &= \frac{9}{16} + 1\\
h^2 &= \frac{25}{16}
\end{align*}', 'To find the length of the hypotenuse, I need to take the square root of both sides:

\begin{align*}
h &= \sqrt{\frac{25}{16}}\\
h &= \frac{\sqrt{25}}{\sqrt{16}}\\
h &= \frac{5}{4}
\end{align*}', 'This is the exact answer, but the problem wants me to express it as a decimal to the nearest hundredth.', 'To do that, I can divide 5 by 4 using long division or a calculator.', 'I get 1.25 as the quotient, which is already rounded to the nearest hundredth.', '[# Answer] So, the final answer is 1.25 miles.', '# Answer

